	(527, 714, 100, 8, '2018-11-14', '14:54:00', 1, '27905019', 'Consumidora informa : Compré una mayonesa vigente y tiene unos puntitos azules al destaparla tanto en el interior como en el exterior , que es pintura? Me voy a dar la tarea de tirarla porque me da miedo.\r\nMayonesa con puntos azules ', 1, 4, '2018-11-16 12:14:49', '2018-11-16 12:14:49');
