	(529, 706, 61, 5, '2018-11-16', '09:17:00', 1, '1053775091', 'JOSE HERNAN GARCIA GONZALEZ, se presenta y es cordial en el saludo, indica el guion legal, para dar inicio a la oferta dice que la tasa bajo, razón por la que el banco quiere invitarlo a rediferir unificando a un mismo plazo y la tasa vigente, logra captar la atención del cliente y hace pregunta filtro, indica en cuanto quedo la tasa actual, resalta los beneficios de aceptar y genera su primer cierre, cliente responde viendo viable un plazo de 18 meses, como buena practica oferta el fixed antes de reformular el primer servicio, para esta oferta es clara con la información dejándolo como un servicio preventivo, cliente acepta, se reformula y aquí indaga que el cliente no se encuentre en mora, el sr responde que efectivamente tiene pendiente un pago que realizar ese mismo día, así que con acuerdo de pago se continua con la aplicación, reformula correcto y completo adicional antes de finalizar oferta la tc afiliada pero cliente no acepta.\r\n', 1, 4, '2018-11-16 12:31:52', '2018-11-16 12:31:52');
