	(534, 715, 90, 8, '2018-11-14', '09:32:00', 1, '27875405', 'Consumidor adquirió dos PINGUINO CREMOSSITO FRUTILLA 900ML en establecimiento Portal de San Borondon, manifiesta que al momento de destapar su primer helado identifico bajo contenido pero así lo consumió, también menciona que después al destapar su segundo helado presenta las misma características.', 1, 4, '2018-11-16 12:50:43', '2018-11-16 12:50:43');
