	(536, 709, 82, 5, '2018-11-16', '10:05:00', 1, '1023722672', 'JUAN FERNANDO ZAPATA PEREZ, se presenta, vocaliza y tiene buen volumen de voz, indica el guion legal, e inicia la oferta indicando la deuda que se tiene en la tarjeta crédito, seguido realiza pregunta filtro, cliente no entiende muy bien la pregunta, ella se asegura de que el entienda y termina manifestando que si tiene una  compra de cartera pero se percibe que la asesora malinterpreta su respuesta asumiendo que no tiene,  le explica el foco de rediferir resaltando como ventaja principal la aplicación de la tasa actual mas baja, cliente indica que no se siente cómodo manejando plazas tan largos, se da manejo y los argumentos que utiliza son validos, ademas se escucha muy segura de la información, el cliente algo indispuesto indica que cuanto tiempo le falta para terminar de pagar lo que debe y al responder que no se cuenta con esa información el cliente muy apático indica nuevamente que no le interesa y que no acepta ninguna modificación a su tarjeta , asesora finaliza la llamada \r\n', 3, 4, '2018-11-16 13:45:43', '2018-11-16 13:45:43');
