	(585, 754, 57, 5, '2018-11-01', '09:46:00', 2, '9070904', 'JORGE ENRIQUE QUINTERO RUIZ Cliente ya conocía del producto, así que se coloca en contexto brindando información pero no genera un cierre como tal, espera respuesta del cliente y el manifiesta que no necesita el dinero que lo tendrá en cuenta y revisara con su esposa, ella pregunta cuando podría tener respuesta, a lo que el cliente responde que el ahora no tomara nada que queda agradecido y  cuando lo necesite se contactara con nosotros, la asesora solo responde que agradece el tiempo y finaliza la llamada sin siquiera permitir que el cliente se despida.\r\n', 3, 4, '2018-11-21 15:38:53', '2018-11-21 15:38:53');
