	(586, 755, 56, 5, '2018-11-09', '07:57:00', 2, '94507662', 'JAIRO MUNOZ MOSQUERA\r\nSe oferta el producto, cliente escucha atentamente, se genera el cierre y el cliente indica que lo agradece pero no le interesa, la asesora da mas beneficios  indicando que por si lo quiere tomar mas adelante, en vez de despertar su interés en el momento y cerrar la venta, no realiza ninguna gestión comercial al cliente y finaliza la llamada.\r\n', 3, 4, '2018-11-21 15:45:42', '2018-11-21 15:45:42');
