	(609, 771, 63, 5, '2018-11-08', '12:06:00', 2, '10010156', 'JUAN CAMILO GALVIS MEJIA\r\nAl escuchar la oferta, el cliente indica que no tiene activa la tarjeta, sin embargo la asesora continua brindando beneficios, el cliente solo manifiesta que no va a activar la tarjeta así que no le interesa afiliar a nadie, pues no va a tener disponibilidad del cupo, asesora continua dando manejo ofertandola a el mismo, y a la final después de solo negarse el cliente finaliza la llamada.\r\n', 3, 4, '2018-11-24 13:59:46', '2018-11-24 13:59:46');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(610, 772, 127, 5, '2018-11-09', '08:19:00', 1, '1049928599', 'YIRIAN DEL CARMEN BABILONIA CARRASQUIL\r\nLa cliente escucha atentamente la oferta, y manifiesta que las obligaciones que tiene, manejan tas inferiores, se da manejo hablando de tarjetas de marca compartida, pero la cliente manifiesta que no asi que no se cierra la venta.\r\n', 1, 4, '2018-11-24 14:02:49', '2018-11-24 14:02:49');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(611, 773, 127, 5, '2018-11-06', '11:43:00', 1, '31934786', 'MARTHA PATRICIA GIRALDO GARCES\r\nFrente al ofrecimiento la cliente indica adquirió un crédito hipotecario, así que no ve necesario mas dinero, se le explica que la idea es ayudarla a consolidar sus pequeñas deudas, a lo que la cliente manifiesta tiene mejores tasa con esas obligaciones.  \r\n', 1, 4, '2018-11-24 14:03:57', '2018-11-24 14:03:57');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(612, 774, 127, 5, '2018-11-09', '15:24:00', 1, '3078473', 'JOSE RAMIRO CORCHUELO MELO\r\nEs una llamada agendada, donde el cliente manifiesta que recibió llamada ese mismo día de otra entidad y realizo compra de cartera con una tasa inferior.\r\nLa gestión realizada por la asesora es buena, el conocimiento y manejo que dio al producto es de resaltar. tipifica de forma correcta.\r\n', 1, 4, '2018-11-24 14:06:00', '2018-11-24 14:06:00');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(613, 775, 128, 5, '2018-11-14', '17:47:00', 1, '43708088', 'MARIA MAGDALENA GOMEZ ECHAVARRIA\r\nSe indagan posibles deudas para recoger, y la cliente manifiesta tiene sus deudas al 0,98%, el asesor da manejo (utiliza muy bien la información) , a lo que la cliente responde que sus demás deudas son con nuestra entidad, motivo por el cual no es viable la oferta. \r\n', 2, 4, '2018-11-24 14:08:51', '2018-11-24 14:08:51');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(614, 777, 128, 5, '2018-11-06', '13:10:00', 1, '41778950', 'ESMERALDA RAMIREZ VALENCIA\r\nDentro de la llamada, oferta muy bien el producto, es claro con la información del producto, cuando la cliente escucha la tasa, indica que otro banco le ofrece una mejor, el asesor da manejo resaltando los beneficios que tendría al aceptar la oferta ,sin embargo la cliente indica que no le interesa.\r\n', 2, 4, '2018-11-24 14:10:35', '2018-11-24 14:10:35');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(615, 776, 128, 5, '2018-11-06', '08:16:00', 2, '20582705', 'MARIA BLANCA SILVA DE BELTRAN\r\nFrente a la oferta la cliente manifiesta que hace poco realizo una compra de cartera, y no tiene interés de retirarse de dicha entidad, el asesor da manejo resaltando la tasa de interés, y la sencillez del procedimiento, la cliente indica que no desea realizar modificaciones pero no se evidencia que mencione que tiene mejor tasa.\r\n', 2, 4, '2018-11-24 14:11:57', '2018-11-24 14:11:57');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(616, 778, 82, 5, '2018-11-15', '12:00:00', 1, '16652552', 'EDINSON HURTADO NARVAEZ\r\nAl escuchar el ofrecimiento, el cliente indica que Colpatria le presto 14MM asi que no necesita y pues tiene una deuda con Falabella pero no le parece que la tasa ofertada sea un beneficio, así que sin importar el manejo de la asesora quien utiliza muy buenos argumentos como la cuota decreciente, no acepta. \r\n', 2, 4, '2018-11-24 14:14:47', '2018-11-24 14:14:47');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(617, 779, 125, 5, '2018-11-07', '18:29:00', 1, '39433869', 'CLARA BEATRIZ ECHEVERRI SANIN\r\nDentro de la interacción al escuchar la tasa, la cliente manifiesta que sus deudas financieras están con una deuda menor a la indicada así que no le interesa la oferta, la asesora intenta dar manejo con el tema de cuota fija pero a pesar del manejo que brinda, la cliente no tiene mas deudas que las indicadas con tasa menor.\r\n', 1, 4, '2018-11-24 14:18:01', '2018-11-24 14:18:01');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(618, 780, 125, 5, '2018-11-06', '15:21:00', 1, '72151766', 'LUIS EDUARDO RIOS MEJIA\r\nEl audio es muy regular, cuando se indaga por deudas pendientes el cliente pregunta por la tasa efectiva anual, y al recibir respuesta indica que las únicas deudas que maneja con una tasa mayor a la ofertada es con nuestra entidad, pues su otra obligación esta menor, con Bancolombia al 8,7%EA, razón por la que no ve beneficio en nuestra oferta y no acepta.\r\n', 1, 4, '2018-11-24 14:19:23', '2018-11-24 14:19:23');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(619, 781, 125, 5, '2018-11-08', '12:26:00', 1, '41489977', 'ELIZABETH TORO MERA\r\nCuando se indaga acerca de deuda, la cliente manifiesta que solo tiene productos con  nuestra entidad, y un crédito de vehículo con una mejor tasa así que no lo ve como beneficio, la asesora da manejo con el tema de la cuota, pero la cliente indica prefiere quedarse como esta, y no acepta.\r\n', 1, 4, '2018-11-24 14:20:28', '2018-11-24 14:20:28');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(620, 782, 124, 5, '2018-11-08', '14:08:00', 1, '39758007', 'MERY JESUS MOLINA PENA\r\nDentro de la gestion la cliente manifiesta que necesita el dinero pero no puntualmente para el pago de una obligacion, pues su unica deuda es un credito de vehiculo que esta a una tasa inferior de la ofertada, a pesar del manejo brindado por el asesor, ella se niega a aceptar.\r\n', 1, 4, '2018-11-24 14:27:39', '2018-11-24 14:27:39');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(621, 783, 124, 5, '2018-11-07', '17:45:00', 1, '51635151', 'GILMA MARIA BELLO CABRA\r\nResalta el manejo del producto, la cliente no entiende muy bien la oferta pues pregunta si puede pagar el mismo credito rotativo, para continuar con el beneficio indaga acerca de mas deudas y aquí indica que tiene una tarjeta credito del Bogota pero la tasa es preferncial y menor a la ofertada, asi que no le interesa\r\n', 2, 4, '2018-11-24 14:28:36', '2018-11-24 14:28:36');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(622, 784, 124, 5, '2018-11-09', '11:47:00', 1, '16765692', 'DANILO OROZCO BONILLA\r\nDurante la gestion el cliente indica no esta interesado en la oferta, pues su unica deuda tiene una tasa muchisimo mejor pues tiene tratamiento especial en su banco, se da manejo indagando por mas deudas tal ves con montos pequeños pero el cliente indica que no, pues la unica que tiene no le favorece esa tasa. \r\n', 1, 4, '2018-11-24 14:29:40', '2018-11-24 14:29:40');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(623, 785, 54, 5, '2018-11-15', '09:12:00', 1, '52249646', 'ALEXANDRA BAUTISTA ACOSTA\r\nDurante la gestión la cliente hace bastantes preguntas frente a la cuota de manejo, se indica al valor que se le cobraría, no esta de acuerdo e indica que con su tc principal  maneja una condición para la exoneracion, se da el correspondiente manejo, la cliente queda en consultarlo pero en el nuevo contacto no da mayor razón e indica que no la acepta.\r\n', 1, 4, '2018-11-24 14:36:41', '2018-11-24 14:36:41');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(624, 786, 59, 5, '2018-11-09', '09:24:00', 1, '79900461', 'EDWIN JOHANNY PINZON ORTIZ\r\nEl cliente escucha la oferta e indica que no esta interesado en que le entreguen mas tarjetas si no se tiene un cupo adicional, pues tendar que cubrir gastos de cuota de manejo sin verse benficiado, hay manejo pero el cliente se niega a aceptar.\r\n', 2, 4, '2018-11-24 14:38:50', '2018-11-24 14:38:50');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(625, 787, 79, 5, '2018-11-15', '07:59:00', 1, '16682897', 'HAROLD RODRIGUEZ AGUADO\r\nSe realiza ofrecimiento del producto, y el cliente manifiesta que ya tiene 3 tarjetas de crédito y no le interesa tener una mas, el asesor da manejo y durante este el cliente indaga por cobros, se le informa que si tiene un cobro y continua haciendo preguntas acerca del producto, a la final indica que no esta interesado en asumir un gasto adicional como la cuota de manejo.\r\n', 2, 4, '2018-11-24 14:49:43', '2018-11-24 14:49:43');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(626, 788, 75, 5, '2018-11-02', '12:15:00', 1, '16661852', 'CARLOS ANTONIO DIEZ VIVAS\r\nEl cliente indica que lo único que le interesa es comprar la cartera de nuestra entidad, ya que no tiene ninguna otra obligación, el asesor da manejo, y el señor algo indispuesto que sus únicas deudas son con nosotros y finaliza la llamada. Frente a su gestión comercial , mejoro bastante desde su ultima realimentación\r\n', 2, 4, '2018-11-24 14:53:08', '2018-11-24 14:53:08');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(627, 794, 69, 5, '2018-11-21', '17:39:00', 1, '1073504412', 'DANIEL ALFONSO MELENJE ASTUDILLO, se presenta de forma correcta, continua agradeciendo por el buen manejo, habla de una linea de crédito extrafinanciamiento, vinculado a su tarjeta crédito con una tasa de interés preferncial, solo da información, no hace preguntas ni identifica necesidades, se tiene un monto de 20MM , pero sin que el cliente manifieste negativa ya se baja en el momento, cliente manifiesta que la tas esta muy alta, indica que esta aprobado, cuando es un pre aprobado, no habla de la cuota decreciente.\r\n', 2, 4, '2018-11-24 15:21:12', '2018-11-24 15:21:12');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(628, 789, 60, 5, '2018-11-20', '10:20:00', 1, '79938885', 'CARLOS ARTURO MARTINEZ MEDINA, se presenta de forma enérgica y cumple con el guion, indica que se le tiene aprobada una linea de extrafinanciamiento, en realidad es una linea pre aprobada, da ejemplos de como puede utilizar el dinero, cuando el cliente ya indica que no la necesita , oferta un monto menor, y resalta la tasa de interés, se expresa muy bien y maneja los tonos de voz a su favor, los argumentos utilizados son validos, sin embargo el cliente continua negandose e indica que no entiende, se le explica a fondo el Alop, y cuando entiende la oferta se niega, se dio buen manejo.\r\n', 2, 4, '2018-11-24 15:27:35', '2018-11-24 15:27:35');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(629, 790, 62, 5, '2018-11-22', '11:34:00', 1, '7918561', 'LIBARDO JAIME HOLLMAN LLAMAS, es muy cordial en el saludo, y genera empatia de inmediato con el cliente, indica el guion, oferta el alop indicando que a través de su tarjeta crédito el banco ha habilitado una linea de crédito (también indica aprobada), nombra la tasa de interés y capta la atención del cliente, quien indica que le interesa pero que la tasa esta muy alta, se da manejo con buenos argumentos, y a todas la preguntas realizadas por el cliente se da respuesta acertada, da la opción de utilizar el dinero para recoger deudas, cliente pide ser contactado nuevamente mientras revisa sus deudas y si realmente es viable. hacer seguimiento de dicho contacto\r\n', 1, 4, '2018-11-24 15:36:00', '2018-11-24 15:36:00');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(630, 792, 81, 5, '2018-11-22', '15:48:00', 1, '1130615073', 'JHON ALEXANDER TENORIO BOLANOS, se presenta de forma correcta y cumple indicando el guion, (AUN HABLA DEL BUEN MANEJO CON LOS PRODUCTOS) No indica el nombre del producto Extrafinanciamiento, cliente la escucha atentamente, y cuando la asesora realiza una pregunta al cliente acerca de la aceptación, este le indica que agradece el ofrecimiento, pero lo que esta haciendo actualmente es terminar de pagar nuestros productos para generar el cierre de los mismos, se indaga el motivo, y el cliente indica que por motivos personales, esta cerrando todos sus portafolios en distintas entidades, pero que esta agradecido por los servicio prestados, sin embargo no es algo que este en sus planes aceptar. asesora entiende razones del cliente y finaliza.\r\n', 4, 4, '2018-11-24 15:45:11', '2018-11-24 15:45:11');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(632, 795, 71, 5, '2018-11-23', '10:46:00', 1, '1020764319', 'SANDRA NAYIBE NINO ROMERO, es cordial y se presenta correctamente, habla de una linea habilitada vinculada a su tarjeta crédito, totalmente aprobada, resalta el sencillo manejo del proceso y la tasa de interés, ademas de no contar con cuotas de manejo, la cliente responde positivamente ante las acuerdos que realiza la asesora, se hacen simulaciones de las cuotas a pagar , falta mas interacción de la cliente,  empieza a realizar preguntas para lograr identificar la necesidad de la cliente, pero aquí la cliente empieza a negarse, se indagan los motivos y la cliente indica que no siquiera usa el cupo de su tarjeta y al intentar dar manejo, se rehúsa a escuchar , se oferta producto adicional e igualmente se niega a aceptarlo\r\n', 2, 4, '2018-11-24 15:53:36', '2018-11-24 15:53:36');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(633, 793, 80, 5, '2018-11-22', '13:19:00', 1, '1019023964', 'JEIMY SURLEY PINEDA RINCON, se dirige con mucho respeto a la cliente, y se percata que pueda atenderle, indica el guion legal, oferta el producto de forma clara y realiza pregunta filtro, continua con su gestión explicando el beneficio de rediferir, hace una simulación a un plazo de 12 meses  Y LA CLIENTE INDICA QUE ES UN PLAZO MUY LARGO, el asesor da manejo y explica que seria para AHORRAR EN INTERESES, PERO ASEGURA QUE LA CLIENTE TENIA TASA DEL 2.35% EN SUS COMPRAS, CUANDO ES UNA INFORMACIÓN QUE EL NO POSEE, comentárselo para evitar que lo siga haciendo, la cliente indica que casi todo lo tiene a una cuota y que definitivamente no desea hacer modificaciones, se oferta afiliada, y a pesar del manejo, también se niega.\r\n', 2, 4, '2018-11-24 16:06:01', '2018-11-24 16:06:01');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(634, 791, 74, 5, '2018-11-23', '10:56:00', 1, '64870814', 'BRENDA LUZ REDONDO NUNEZ, se presenta de forma correcta, cumple indicando el guion legal, presenta el producto de forma tal que la cliente entiende de inmediato el beneficio de rediferir, realiza pregunta filtro, buscando no afectar las tasas que ella este manejando, adicional todas las preguntas que realiza las hace de manera que reciba respuesta positiva de la cliente, y genera el cierre fácilmente, al reformular, se asegura de que la cliente este al día y cumple con todo el guion, al final oferta la afiliada y da manejo a la negativa de la cliente, sin embargo esta no acepta', 1, 4, '2018-11-24 16:12:49', '2018-11-24 16:12:49');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(635, 796, 63, 5, '2018-11-23', '15:17:00', 1, '79343439', 'LUIS CARLOS AMAYA PORRAS, esta hablando mas pausado, se presenta de forma correcta e indica el guion, habla de un programa para la deuda de su tc, hace pregunta filtro , e indica que se tiene un beneficio para la tasa, ya que actualmente bajo, se asegura que el cliente este entiendo y este pregunta que tasa tiene el, habla de hasta del 2.40, sin asegurar una como tal, es persuasiva buscando su aceptación, falta mas fuerza en el cierre, si capta la atención del cliente, pero el quiere validarlo con su esposa, así que pide ser contactado nuevamente, hacer seguimiento de que si lo realice\r\n', 1, 4, '2018-11-24 16:30:04', '2018-11-24 16:30:04');
