	(648, 804, 94, 8, '2018-11-26', '11:25:00', 1, '28337762', 'Consumidora se comunica ya que al día de hoy no se le ha llamado a darle respuesta de lo sucedido con el análisis de la muestra que envió con los objetos extraños y exije se le de una respuesta lo mas pronto posible ya que esto lleva según ella mucho tiempo y esto para ella es inaudito y una falta de respeto total \r\n"Al consumir mayones hellmans, sentí un fuerte dolor y sonido, era una de mis piezas dentales que se fracturo, por un pequeño objeto plástico y duro, proveniente de alimento. "', 1, 4, '2018-11-27 15:16:15', '2018-11-27 15:16:15');
