	(649, 832, 64, 5, '2018-11-26', '15:49:00', 1, '22739645', 'LUCELYS MARIA CASTRO RUDAS\r\ndesde el inicio es cordial se presenta e indica el guion legal,( ya dejo de repetir el nombre) iniciando la oferta realiza pregunta filtro, habla de tomar los saldos de deuda y dejarlo a un mismo plazo y misma tasa, ya que la tasa bajo, se explican los beneficios puntuales de rediferir, cliente se niega, asesora es persuasiva buscando la aceptación y da manejo a las objeciones, pero a pesar de la buena gestión la cliente, empieza a hacer preguntas acerca de una compra de cartera, asesora retoma y tiene el control, la cliente entonces solo busca terminar la llamada pues insiste en que no quiere financiar.\r\n', 1, 4, '2018-11-27 16:00:21', '2018-11-27 16:00:21');
