	(650, 834, 73, 5, '2018-11-26', '15:53:00', 1, '72252607', 'GEOVANNY ALBERTO AHUMADA ANGULO\r\ncumple indicando el protocolo inicial, para brindar la oferta continua reconociendo el buen manejo de los productos, nombra la deuda y hace la pregunta filtro, cliente indica que es por tasa preferencial, asesora explica cual es el beneficio de rediferir, pero cliente ve que no es viable, se ofertan los productos adicionales cliente interrumpe y finaliza la llamada', 2, 4, '2018-11-27 16:01:47', '2018-11-27 16:01:47');
