	(651, 836, 57, 5, '2018-11-26', '15:53:00', 1, '522407', 'ANSELVI JOSE RADA CASTILLO\r\nsu saludo es dinámico, y cumple el protocolo inicial, habla del buen manejo razón por la que se le aprobó una linea de crédito, cliente interrumpe indicando que no tiene en que usarlo, la asesora da manejo hace ejemplos de como podría utilizar el dinero y es persuasiva buscando la aceptación del cliente, pero este insiste en que no tiene en que invertirlo, se oferta producto adicional,e igualmente se niega.\r\n', 1, 4, '2018-11-27 16:05:06', '2018-11-27 16:05:06');
