	(653, 835, 60, 5, '2018-11-26', '11:33:00', 1, '12120366', 'ARLES ATAHUALPA QUIMBAYA\r\nse presenta e indica el guion legal, se habla de una linea aprobada, nombra 2 caracteristicas principales, genera primer cierre y el cliente se niega indicando que no los necesita, se da manejo resaltando los beneficios, y hace una muy buena gestion buscando que el cliente tome una decision, sin embargo el cliente le indica que no le interesa y desea finalizar la llamada, se oferta la tarjeta adicional pero cliente solo desea colgar.', 2, 4, '2018-11-27 16:07:33', '2018-11-27 16:07:33');
