	(670, 844, 62, 5, '2018-11-27', '10:20:00', 1, '8691373', 'JORGE ARTURO LAHMANN RODRIGUEZ\r\nSe presenta y cumple indicando el guion legal, oferta el producto manifestando que a traves de la tarjeta que tiene activa se ha habilitado una linea de credito (ya aprobada, SE BAJO LA INFORMACION DESDE LAS 11, PARA QUE SE INDIQUE PRE APROBADO) por un monto de 20MM a libre destino y con tasa preferencial, cliente indica ya tenia la informacion y que por ahora no quiere endeudarse mas, se da manejo indicando que no hay apertura de un nuevo producto y resalta la  tasa que es menor a la manejada por la tarjeta,lo oferta de forma sencilla para que el cliente entienda el beneficio, es muy buena manejando la informacion y convence al cliente de tomar una parte del dinero, reformula de forma correcta y completa, hace pausas dentro de la misma identificando la aceptacion del cliente, utiliza protocolo de despedida\r\n', 1, 4, '2018-11-28 17:52:45', '2018-11-28 17:52:45');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(671, 848, 56, 5, '2018-11-27', '14:13:00', 1, '1015435398', 'HECTOR ANDRES LEON GONZALEZ\r\nde inicio cumple con el protocolo inicial, habla de un cupo de extrafinanciamiento pre aprobado por 4.600MM adicionales a el cupo ya activo de la tarjeta credito, reslata la tasa de interes, y el cliente indica que esta muy alta, ella da manejo con el argumento de las cuotas decrecientes, el continua negandose y hace preguntas respecto a las tasa manejadas para compra de cartera, la asesora da buen manejo respondiendo a sus preguntas y retomando el ofrecimiento, sin embargo el cliente se niega indicando que todos sus productos los maneja con tasa inferior a la ofertada \r\n', 2, 4, '2018-11-28 17:54:04', '2018-11-28 17:54:04');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(672, 845, 81, 5, '2018-11-27', '12:46:00', 1, '3158828', 'CLIMACO SIERRA VELASQUEZ\r\nSe presenta e indica el guion legal, (continua resaltando el buen manejo de los productos, cuando se ha solicitado que deje de hacerlo) ya habla de una linea de extrafinanciamiento, indica principales caracteristicas del producto resaltando el interes preferencial, genera primer cierre preguntando la cantidad que desea aceptar, la rspuesta del cliente es negativa se da manejo con argumentos validos, el cliente manifiesta esta muy endeudado con nuestra entidad con aprox 110MM, asi que no lo ve viable, asesora continua dando manejo, pero el cliente no acepta y finaliza la llamada.\r\n', 2, 4, '2018-11-28 17:54:59', '2018-11-28 17:54:59');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(673, 843, 54, 5, '2018-11-27', '07:42:00', 1, '43607739', 'ISABEL CRISTINA GIRALDO ALZATE\r\nEs enérgico en el saludo, y se presenta e indica el guion de forma correcta, habla del pre aprobado de una extensión de su tarjeta de crédito para compartir su cupo con un tercero, la cliente de inmediato se niega , se da manejo y sigue manteniéndose en el no, así que el asesor la oferta para ella misma a manera de seguridad sensibilizándola frente al alto cupo que tiene en su tarjeta, ante esta información la cliente si se interesa, el asesor explica el método y la Sra. pide ser contactada mientras se desocupa y tiene tiempo de analizar la oferta, hacer seguimiento del contacto pactado. (Muy buena gestión, ha mejorado mucho en la transparencia de  la información y como oferta la tarjeta) \r\n', 2, 4, '2018-11-28 17:56:30', '2018-11-28 17:56:30');
