	(674, 846, 75, 5, '2018-11-27', '11:56:00', 1, '51732893', 'OMAIRA TERESA BORDA QUINTERO\r\nEs bastante empatico en el saludo y cumple protocolo inicial, (resalta el buen manejo de los productos, cuando ya se ha dicho que no lo haga mas) oferta para compra de cartera una tasa preferncial del 0,99%, e indaga sobre posibles deudas que la cliente pueda tener, cliente valida e indica que le debe a davivienda por una tarjeta crédito, un aprox de 4MM, el asesor le explica como se realizaría el proceso y confirma monto aprobado por el banco para brindarle, aquí pierde interés debido a se aprueba casi que la mitad de lo que ella debe, el asesor es persuasivo y da manejo resaltando los beneficio de aceptar y hacer un pago parcial, sin embargo la cliente no acepta la oferta. \r\n', 1, 4, '2018-11-28 17:58:55', '2018-11-28 17:58:55');
