	(686, 864, 71, 5, '2018-11-28', '12:33:00', 1, '3522846', 'DIDIER ALBEIRO TAMAYO PULGARIN, Es cordial desde el saludo y cumple con el guion legal(nuevo producto cuenta ahorros) habla del buen manejo con los productos cuando se ha indicado que no lo haga, de inicio se rige al guion y seguido indaga la entidad con la que tiene su cuenta de nomina, el cliente indica que es bancolombia y que con ella tiene diversos beneficios por tener convenio con su empresa, la asesora da un correcto manejo ,indicando que es el quien puede elegir con que entidad tiene su nomina, el cliente continua negandose, entonces la asesora opta por que habilite una cuenta con nuestra entidad, y ahorre. pero el cliente no esta interesado y agradece el contacto.\r\n', 2, 4, '2018-11-29 15:04:28', '2018-11-29 15:04:28');
