	(687, 859, 67, 5, '2018-11-28', '08:41:00', 1, '15960903', 'FAVER ALVAREZ OROZCO, se presenta e indica el guion legal, inicia la oferta indicando que su saldo puede ser unificado a un mismo saldo y misma tasa teniendo en cuenta que la tasa bajo en comparación a meses anteriores, se realiza pregunta filtro, y hace simulación con el menor plazo a 12, genera pregunta de cierre y el cliente manifiesta que el ya había dicho que no necesitaba, se da manejo pero ante los argumentos que la asesora utiliza el cliente solo se niega a aceptar alguna modificación, se oferta afiliada y a pesar del manejo tampoco acepta.\r\n', 2, 4, '2018-11-29 15:27:09', '2018-11-29 15:27:09');
