	(689, 862, 82, 5, '2018-11-26', '14:22:00', 1, '30230407', 'DIANA CAROLINA BUITRAGO MOLINA\r\nse presenta e indica el guion legal, al brindar la oferta es clara con la información indicando que para su crédito rotativo se habilita una tasa preferncial, con el fin de consolidar obligaciones, cliente muestra interés , así que la asesora explica las dos modalidades, la cliente indica que necesita mas dinero, así que se propone una compra parcial todo con el fin de que la cliente aproveche la tarjeta crédito, sin embargo la cliente indica no le sirve asi, y que si pueden ofrecerle mas dinero se animaria a hacerlo de lo contrario no!, asesora explica el porque solo esta aprobado 10MM, y finaliza con protocolo correcto ', 2, 4, '2018-11-29 16:23:34', '2018-11-29 16:23:34');
