	(719, 948, 49, 15, '2018-12-03', '15:34:00', 1, '28557268', '', 1, 4, '2018-12-03 17:30:43', '2018-12-03 17:30:43');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(720, 950, 126, 5, '2018-11-19', '15:21:00', 1, '1032454894', 'NELSON FABIAN SIERRA AVILA\r\nSe presenta e indica el guion legal, para dar inicio a la oferta manifiesta que el banco da la opción de unificar su deuda a un mismo plazo y misma tasa, resaltando la baja de la actual, se expresa de forma correcta y segura, adicional de ser puntual con la información, hace pregunta filtro y genera de inmediato su cierre, al reformular lo hace completo y correcto, asegurándose que el cliente no se encuentre en mora.\r\n', 1, 4, '2018-12-03 18:46:53', '2018-12-03 18:46:53');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(721, 953, 129, 5, '2018-11-15', '10:05:00', 1, '1018411564', 'DIANA LUCIA PEREZ HERNANDEZ\r\nse presenta e indica el guion legal, pronuncia bien el nombre del banco, habla de prestar un mejor servicio para mejorar el flujo de caja, unificanddo su deuda actual con la tasa actual mas baja, realiza pregunta filtro, hace simulación con los distintos plazos, cliente ve viable el de 12 meses y se cierra la venta, reformula sin interrupciones y de forma correcta, muy buena gestion y manejo de cliente.\r\n', 1, 4, '2018-12-03 18:48:33', '2018-12-03 18:48:33');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(722, 951, 126, 5, '2018-12-15', '15:39:00', 1, '71588894', 'RODOLFO ALFONSO RAAD VILLA\r\nCumple con el protocolo inicial, brindando la oferta se escucha segura, y realiza pregunta filtro, (mal audio) habla de la reducción de la tasa, resaltando el beneficio de rediferir, pero el cliente manifiesta que el no tiene deuda en su tarjeta, por que normalmente envía todo a una cuota, la asesora da manejo para recuperar la confianza del cliente y finaliza la llamada \r\n', 1, 4, '2018-12-03 18:50:17', '2018-12-03 18:50:17');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(723, 949, 125, 5, '2018-12-29', '09:30:00', 1, '71660922', 'LUIS FERNANDO YEPES SIERRA\r\nSe presenta y cumple indicando el guion legal, el sr. desde el principio es muy apático ante la información, resalta el manejo, cuando ya se ha dicho que no lo hagan mas, resalta la tasa de interés para la consolidación de obligaciones con otras entidades, indaga acerca de deudas y el cliente indica que si le interesa pero en el momento se encuentra muy ocupado, por lo que pide ser contactado después, hacer seguimiento de dicho contacto.\r\n', 1, 4, '2018-12-03 18:52:30', '2018-12-03 18:52:30');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(724, 952, 127, 5, '2018-11-29', '09:14:00', 1, '19462845', 'CARLOS ALBERTO PENUELA GARZON\r\nSe presenta e indica el guion legal, habla sobre el motivo de su llamada buscando beneficiarle con una tasa del 1,45 para la consolidación de mas obligaciones, sin sobre endeudarlo ya que se tomaría del disponible de su producto ya activo el crédito rotativo, indaga por deudas, y el cliente manifiesta que le interesara para la tc de nuestra entidad, asesora le explica que no es posible y da manejo, despertando el interés del cliente pero este indica que el aprobado es muy bajo, se da una opción que es valida, el cliente pide tiempo para analizar y se agenda un nuevo contacto, muy buena gestión no se quedo con la negativa inicial del cliente.\r\n', 1, 4, '2018-12-03 18:54:05', '2018-12-03 18:54:05');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(725, 956, 128, 5, '2018-11-30', '08:54:00', 1, '79861732', 'VICTOR MANUEL PEDRAZA JULIO\r\nCumple protocolo inicial, maneja un buen volumen de voz, iniciando la oferta indica que se le habilito una tasa preferncial, con el fin de consolidar deudas con otras entidades, genera cierre inmediato, captando la atención del cliente, se expresa muy bien deja claridad de la información y condiciones, el cliente indica que esta algo ocupado y necesita validar si le conviene o no! propone un contacto cercano validar que lo realice.\r\n', 1, 4, '2018-12-03 18:56:18', '2018-12-03 18:56:18');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(726, 957, 126, 5, '2018-11-23', '11:21:00', 1, '43167177', 'JOHANNA ANDREA LONDONO BENJUMEA\r\nse presenta e indica el guion legal, es empatica desde le inicio de la llamada al brinda r la información es clara y genera pregunta filtro, cliente no esta muy segura de si tiene o no tasas preferenciales, indaga bien , para no llegar a afectarla, resalta la baja de la tasa de interés y habla de la unificación a un mismo plazo, genera el primer cierre y la cliente indica le interesa pero debe revisarlo, se propone nuevo contacto para cerrar la venta, revisar que se realice.\r\n', 1, 4, '2018-12-03 18:57:58', '2018-12-03 18:57:58');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(727, 954, 129, 5, '2018-11-23', '17:56:00', 1, '52423082', 'MARIA ROSARIO JARAMILLO FONNEGRA\r\ncumple protocolo inicial, y de inicio resalta la baja de la tasa de interés, hace pregunta filtro, al brindar la información es muy segura y clara, hace distintas simulaciones y pregunta a la cliente sobre que plazo le queda mas cómodo llevando al cierre de la venta, se asegura que la cliente no tenga moras, y reformula completo y correcto, excelente gestión.\r\n', 1, 4, '2018-12-03 18:59:29', '2018-12-03 18:59:29');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(728, 955, 129, 5, '2018-11-26', '09:07:00', 1, '91536737', 'ESTEBAN ALFARO SABOGAL\r\nManeja un buen volumen de voz y un ritmo en la llamada, que le permite ser clara con a la info, cumple el protocolo inicial, brinda la oferta y realiza la pregunta filtro oportunamente, cliente duda y no brinda respuesta ella da manejo y el indica que son normales, continua con su gestión y genera el cierre, pero el cliente indica que no le da confianza, así que se acercara al banco de necesitar alguna modificación, ella da manejo pero el solo se niega y termina la llamada.\r\n', 1, 4, '2018-12-03 19:01:18', '2018-12-03 19:01:18');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(729, 958, 129, 5, '2018-11-28', '13:56:00', 1, '52018897', 'CLARA INES ESCOBAR APONTE, \r\ncumple indicando el guion legal, y se presenta de forma correcta, evidencia que no puede ofertar el rediferido por fecha final de gestión, así que oferta el fixed, lo hace de forma correcta pero falta explicar un poco mas, la cliente no entiende muy bien lo confunde con el rediferido, se aclara, y cliente pide no realizar ninguna modificación, oferta afiliada, cliente manifiesta que ya las tiene, finaliza aplicando el protocolo\r\n', 1, 4, '2018-12-03 19:08:59', '2018-12-03 19:08:59');
