	(730, 959, 126, 5, '2018-11-28', '12:03:00', 1, '41899670', 'BEATRIZ EUGENIA TOBON GOMEZ\r\nes cordial y empatica en el saludo, cumple con el protocolo, habla del programa fixed, ya que no tenían base de rediferidos, lo explica de forma correcta ofertandolo de forma preventiva y para tener un buen flujo de caja, sin embargo la cliente no lo ve  atractivo indicando que como tiene sus pagos esta perfecto, se oferta afiliada, pero tampoco esta de acuerdo en aceptarla.', 2, 4, '2018-12-03 19:12:55', '2018-12-03 19:12:55');
