INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(764, 1004, 67, 5, '2018-12-05', '11:12:00', 1, '79752143', 'Wilmer Valdes\r\nDayana lo había tipificado como no necesita el dinero, ella recuerda la información, e indica como se realizaría el proceso, cliente muestra interés, y ella genera cierre indicando si tiene el numero de cuenta para realizar el desembolso, cliente continua haciendo preguntas y se da respuesta acertada, debe consultar para brindar una respuesta, pero el cliente le indica que si ese crédito depende de la tarjeta no le interesa, ella da manejo pero el cliente indica que no le interesa seguir pagando la cuota de manejo de esa tarjeta pues la idea seria cancelarla.\r\n', 2, 4, '2018-12-10 11:12:59', '2018-12-10 11:12:59');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(765, 995, 56, 5, '2018-12-05', '15:06:00', 1, '41774170', 'Luz Aida Cruz ML\r\nLa cliente es bastante apática ante el ofrecimiento del producto, la asesora oferta muy bien los beneficios, pero falta indagar para ver si la cliente se anima a brindar mas información y puede rebatir mejor las objeciones, pues solo se niega y se niega y no escucha razones, es persuasiva pero falta cierre. Se presenta baja contabilidad de clientes agendados, se realizan varias marcaciones pero los clientes no contestan', 1, 4, '2018-12-10 11:16:31', '2018-12-10 11:16:31');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(766, 1011, 56, 5, '2018-12-05', '15:24:00', 1, '1015430776', 'Luis Antonio Silva, ML\r\n cliente interrumpe agradeciendo indicando que ya lo habían llamado y ya indicio que no esta interesado, la asesora da manejo a la negativa pero el cliente solo busca colgar, recuerda principales beneficios de aceptar, cliente nuevamente agradece y termina la llamada\r\n\r\n', 2, 4, '2018-12-10 11:19:08', '2018-12-10 11:19:08');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(767, 997, 60, 5, '2018-12-05', '12:00:00', 1, '1144160274', 'Lizeth Ordonez ML\r\nAnte el ofrecimiento la cliente manifiesta que trabaja en un banco y le dan un a mejor tasa, ademas de que no tiene ninguna necesidad actualmente en la cual invertir, se da manejo indicando ejemplos de como usarlo ahorrando por supuesto en intereses, pero la cliente se niega recordando que si lo necesitara le ofrecen mejores tasas.\r\n\r\n', 2, 4, '2018-12-10 11:20:19', '2018-12-10 11:20:19');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(768, 1002, 60, 5, '2018-12-05', '12:09:00', 1, '1016026468', 'Angela patricia Gomez, ML\r\nEl ofrecimiento lo realiza de forma correcta y puntual, ante el primer cierre la cliente indica no la necesita, se indaga el motivo y la cliente indica que no tiene en que invertir, se da un muy buen manejo haciendo comparaciones entre la tasa ofertada frente a la que se maneja con la tarjeta crédito, si por ejemplo lo que quiere es hacer compras de regalos o tiquetes pero la cliente continua negandose, se oferta entonces la afiliada, siempre con gran energía, para este producto si muestra interés, y hace una buena gestión buscando que la cliente brinde los datos cuanto antes, pero lo mínimo que consigue es agendar para hoy a las 4pm\r\n\r\n', 1, 4, '2018-12-10 11:21:51', '2018-12-10 11:21:51');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(769, 1001, 60, 5, '2018-12-05', '12:31:00', 1, '53039624', 'Andrea del pilar Bautista, ML\r\nLa cliente escucha el inicio de la oferta, pero interrumpe e indica que para no perder el tiempo le confirma que no necesita el dinero, al indagar el porque, se limita a decir que no quiere endeudarse, asesora continua su gestión dando manejo indicando ejemplos de como usarlo y resaltando la tasa de interés, la cliente se cierra totalmente a aceptar.\r\n', 2, 4, '2018-12-10 11:23:06', '2018-12-10 11:23:06');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(770, 1003, 62, 5, '2018-12-05', '11:40:00', 1, '24852034', 'Ana Maria Catano ML\r\nle brinda toda la información, teniendo en cuenta que la sra, ya había sido contactada resalta los beneficios principales de aceptar el desembolso, cliente insiste en que no tiene en que usarlo, ella brinda ejemplos de como la beneficiaria usar al menos una parte del monto aprobado y la cliente solo se niega. \r\n', 2, 4, '2018-12-10 11:24:27', '2018-12-10 11:24:27');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(771, 1012, 62, 5, '2018-12-05', '11:46:00', 1, '1015402593', 'Daniel Castillo\r\nSe coloca al cliente en contexto, recordando los beneficios del Alop, pero el cliente interrumpe indicando que le aprobaron un crédito de 25MM así que no necesita este monto, agradece y termina la llamada.\r\n', 2, 4, '2018-12-10 11:25:46', '2018-12-10 11:25:46');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(772, 1005, 68, 5, '2018-12-05', '11:20:00', 1, '53119148', 'Leidy Ramirez, ML\r\nEntrega la información, se escucha muy segura y resalta de forma correcta los beneficios, indaga muy poco, la cliente muestra interés, pero indica que debe consultarlo con su esposo, sin dar ningún manejo la asesora propone una nueva fecha de contacto no muy cercana, se recomienda, preguntar que debe pensar si puede consultarlo hoy mismo, agendar una llamada para horas de la tarde, pero no ser tan permisiva con los tiempos de contacto, dejando pensar mucho al cliente, y corriendo el riesgo que no lo acepte después.\r\n', 2, 4, '2018-12-10 11:26:56', '2018-12-10 11:26:56');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(773, 1008, 81, 5, '2018-12-05', '12:25:00', 1, '41550100', 'Aurora Silva Zamora\r\nes una llamada agendada, entra solicitando datos cliente indica que no los tiene que debe buscarlos, asesora da el manejo y logra que se los de inmediato, realiza reformulacion de forma correcta y sin interrupciones. La asesora lleva 6 ventas, todas agendadas.\r\n', 1, 4, '2018-12-10 11:35:01', '2018-12-10 11:35:01');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(774, 1009, 81, 5, '2018-12-06', '12:05:00', 1, '1016048392', 'Santiago Otalora ML\r\nse presenta y le recuerda los beneficios que tiene el aceptar el desembolso del Alop, resaltando las tasas de interés, cliente indica lo han llamado en repetidas ocasiones y definitivamente no esta interesado, se da manejo indagando para identificar en que puede usar el dinero, cliente se mantiene en la negativa y no escucha mas razones\r\n', 2, 4, '2018-12-10 11:36:17', '2018-12-10 11:36:17');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(775, 996, 59, 5, '2018-12-07', '09:43:00', 1, '16935967', 'Ivan Francisco gracia ML\r\ncorta la llamada, se remarca, cumple con protocolo nuevamente, se le recomienda hablar un poco mas despacio, cliente entiende como funciona el rediferido, pero indica no ve beneficio, el asesor da manejo a la negativa y es persuasivo buscando su aceptación, cliente hace pregunta puntual sobre si aceptar el rediferido le condiciona esa tasa para sus compras futuras, el asesor de forma clara le indica que esa es la vigente y que si cambia , cierra la venta y reformula de forma correcta, al ofertar el fixed lo hace muy seguido y puede existir la duda de si entiende que esta aceptando otro programa.\r\n', 1, 4, '2018-12-10 11:38:16', '2018-12-10 11:38:16');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(776, 1010, 125, 5, '2018-12-06', '16:30:00', 1, '19474719', 'Orlando Echeverria, ML \r\nEl cliente es apático ante la información, la actitud de la asesora es buena y siempre respetuosa brinda bien la información resaltando el benéfico de la tasa, capta la atención del cliente, quien pide tiempo para revisar, es persuasiva indicando que hasta hoy esta esa tasa, información correcta, hace simulaciones con las que logra el cierre de la venta, indaga acerca de la obligación y procede a tomar los datos\r\n\r\n', 1, 4, '2018-12-10 11:40:51', '2018-12-10 11:40:51');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(777, 1013, 127, 5, '2018-12-05', '11:25:00', 1, '60294273', 'LAURA DIAZ RICO. MR ,\r\nEs una venta declinada , al auditrl evidencio dentro de grabación que la asesora habla de mas, contando  a la cliente información que le dio el área de validación, de como es el proceso interno de devolución de las ventas, información que no es relevante para la cliente, ademas de que con la forma en la que se dirigió a la cliente no es la adecuada.', 3, 4, '2018-12-10 11:48:11', '2018-12-10 11:48:11');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(778, 1006, 79, 5, '2018-12-06', '10:05:00', 1, '49759833', 'Eduvina Triana, MR\r\nLa cliente desde un inicio se rehúsa a escuchar la oferta, el asesor es persuasivo y logra brindar principales características, ante la información la cliente solo dice que no la quiere, que ella ya sabe del producto pero que no la quiere,, el asesor continua resaltando los beneficios después de indagar por que no la quiere, pero la sra, no da respuestas y pide terminar la llamada.\r\n', 2, 4, '2018-12-10 11:52:19', '2018-12-10 11:52:19');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(779, 1007, 79, 5, '2018-12-06', '10:08:00', 1, '42883466', 'Luz Amparo Salazar\r\nInicia de forma creativa, indica principales características de la tarjeta, y procede a indagar acerca del grupo familiar de la cliente, capta su interés , ella pregunta  por la cuota de manejo, el asesor brinda la info pero sin resaltar el beneficio que se tiene con las 4 TX, debe hacer ejemplos para que la cliente entienda que solo si tiene tal vez su TC inscrita en Uber, ya estaría exonerada, se traba mucho al hablar lo que hace confusa la transmisión del mensaje.\r\n', 1, 4, '2018-12-10 11:53:52', '2018-12-10 11:53:52');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(780, 1014, 129, 5, '2018-12-07', '16:25:00', 1, '52363640', 'Luz mery luna MR\r\nAl brindar la información es clara y se escucha muy segura de lo que esta hablando, lo que indica es puntual como la tasa y el valor aprobado tomado del RC, al realizar la pregunta de que deudas tiene que se puedan consolidar, la cliente de forma fuerte responde que ninguna, que ya la habían llamado y esta cansada de decir que no lo necesita, se tipifica de forma correcta \r\n', 2, 4, '2018-12-10 11:56:01', '2018-12-10 11:56:01');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(781, 1015, 126, 5, '2018-12-06', '10:40:00', 1, '94321189', 'julio cesar espinoza. MR\r\nResalta de inicio el beneficio de la tasa de interés, cuando indaga por deudas e indica que se tomaría el cupo de su RC, indica que ya lo tiene todo copado y que le va a vender esa cartera a davivienda, que le oferta tasa mas baja, asesora se queda con la respuesta del cliente y no brinda manejo\r\n', 2, 4, '2018-12-10 11:57:53', '2018-12-10 11:57:53');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(782, 1016, 126, 5, '2018-12-07', '12:51:00', 1, '19261241', 'Es un cliente agendado al cual le ha realizado un correcto seguimiento cliente acepta que se realice una compra de cartera, inicia a reformular, al momento de indicar las cuotas cliente hace varias preguntas pero la asesora no da respuesta a lo que el cliente pregunta, falta escucha activa. cliente empieza a dudar de realizar el proceso, y a pesar d mi intervención la Asesora no logra despejar las dudas del Sr. se perciben los nervios y la falta de manejo de la información, el cliente entonces pide tiempo para pensar y ser contactado a las 3pm.\r\n', 3, 4, '2018-12-10 12:00:11', '2018-12-10 12:00:11');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(783, 1019, 71, 5, '2018-12-06', '09:57:00', 1, '1030556220', 'FRANCY MILENA BARBOSA CASTELLANOS, se presenta y cumple indicando el guion legal, para dar inicio a la oferta se rige a la primera parte del script y empieza a realizar preguntas sondeo, buscando identificar lo que necesita la cliente, respecto a lo que ella manifiesta se empiezan a resaltar los beneficio que tendría con nuestra entidad, la cliente indica que le gustaría realizarlo pero hasta el próximo año, pues las novedades ta fueron reportadas, adicional ante el manejo de la negativa la cliente indica que no necesita tener activas 2 cuentas, la asesora es persuasiva buscando su aceptación pero la cliente se mantiene en que ahorita no.\r\n', 2, 4, '2018-12-10 14:17:14', '2018-12-10 14:17:14');
