	(784, 1019, 71, 5, '2018-12-06', '09:57:00', 1, '1030556220', 'FRANCY MILENA BARBOSA CASTELLANOS, se presenta y cumple indicando el guion legal, para dar inicio a la oferta se rige a la primera parte del script y empieza a realizar preguntas sondeo, buscando identificar lo que necesita la cliente, respecto a lo que ella manifiesta se empiezan a resaltar los beneficio que tendría con nuestra entidad, la cliente indica que le gustaría realizarlo pero hasta el próximo año, pues las novedades ta fueron reportadas, adicional ante el manejo de la negativa la cliente indica que no necesita tener activas 2 cuentas, la asesora es persuasiva buscando su aceptación pero la cliente se mantiene en que ahorita no.\r\n', 2, 4, '2018-12-10 14:17:14', '2018-12-10 14:17:14');
