	(785, 1022, 73, 5, '2018-12-05', '12:33:00', 1, '1030582065', 'LUZ ADRIANA PRIETO REY, la asesora logra el contacto después de varios intentos, la cliente pide tiempo, se espera aproximadamente por 5 minutos, retoma y se presenta de forma correcta y completa, oferta la cuenta, e indaga en que entidad tiene su cuenta de nomina, al seguir realizando el sondeo la cliente indica que ella trabaja para la misma entidad con la cual tiene la nomina, así que la asesora opta solo por intentar abrir solo su cuenta de ahorros, continua brindando beneficios, la cliente interrumpe algo indispuesta diciendo que de verdad le agradece, pero no le interesa\r\n', 2, 4, '2018-12-10 14:29:29', '2018-12-10 14:29:29');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(786, 1023, 57, 5, '2018-12-05', '09:16:00', 1, '1014178070', 'PAOLA ANDREA RODRIGUEZ CARDONA\r\nEs cordial y cumple protocolo inicial, la invita a disminuir costos financieros y nombra dos de los mas relevantes, indaga con que entidad se tiene la cuenta, cliente indica Bancolombia, adicional manifiesta que le a ido bien con ellos, la asesora continua hablando de los beneficios, cliente indaga si puede transferir y que se retire el dinero en un baloto, la asesora no tiene la respuesta concisa, pero la respuesta que da es valida y continua resolviendo dudas, la cliente muestra interés en dejar su nomina con nosotros, la asesora la convence y genera cierre para dar inicio a la confirmación, allí cumple indicando toda la información.', 1, 4, '2018-12-10 14:54:15', '2018-12-10 14:54:15');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(787, 1020, 82, 5, '2018-12-07', '11:25:00', 1, '42687255', 'ADRIANA MARIA ARROYAVE HINCAPIE\r\nes enérgica en el saludo y cumple protocolo inicial, es clara con el ofrecimiento aclarando que el dinero se toma de su crédito rotativo , y la tasa la cual le aplica y de inmediato pregunta al cliente si tiene deudas por consolidar,  la Sra. manifiesta que tiene deuda con crédito rotativo aprox de 8MM, y la asesora explica el método de consolidación en este caso indirecta, la cliente escucha atentamente la oferta, e indica que necesita validar si la tasa es viable o no! la asesora da manejo y acuerda un contacto para el mismo día en horas de la tarde, muy buena gestión.\r\n', 1, 4, '2018-12-10 16:06:44', '2018-12-10 16:06:44');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(788, 1018, 63, 5, '2018-12-07', '07:26:00', 1, '37746531', 'ROSANA GUEVARA PLATA, se presenta y es cordial desde el saludo, inicia la oferta con pregunta filtro, a lo que la cliente indica tiene tasa del 0%, la asesora explica el porque de la pregunta cliente no lo ve viable, se oferta el fixed, la cliente indica indica que ya lo tiene aplicado, la asesora indica que no le registra en el sistema y la sra le dice que sin problema lo aplique entonces a 36, se reformula de forma correcta, al finalizar oferta la afiliada, pero la cliente indica que no le interesa\r\n', 1, 4, '2018-12-10 16:15:45', '2018-12-10 16:15:45');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(789, 1017, 54, 5, '2018-12-07', '12:52:00', 1, '51796283', 'ADRIANA LEE RAMIREZ, se presenta e indica el guion legal, comienza diciendo que el banco ya le pre aprobó una extensión de su tarjeta crédito para compartirla con un tercero, ante esto la cliente indispuesta que ella no quiere compartir su cupo con nadie, el asesor da manejo preguntando si tal vez con sus hijos o sus padres, y ella solo continua negandose, así que se oferta para ella misma, como una opción de seguridad, la cliente no le ve beneficio, pues siempre tiene full el cupo de su tarjeta , es persuasivo buscando la aceptación de la cliente, pero ella solo se niega, y pide finalizar la llamada\r\n', 2, 4, '2018-12-10 16:40:51', '2018-12-10 16:40:51');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(790, 1024, 94, 8, '2018-12-29', '16:04:00', 1, '28471836', 'Consumidor(a) se comunica ya que compro un SKIP LIQ DILUIDO DOYP 4X3000ML (Retail) y menciona que este trae Una consistencia más aguada de lo normal además ya que esto es algo que nunca antes le había pasado llama a reportarlo. ', 1, 4, '2018-12-10 16:49:56', '2018-12-10 16:49:56');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(791, 1021, 74, 5, '2018-12-10', '09:51:00', 1, '8716473', 'JHONNY SILVA CHIMENTY, es enérgico con el saludo y cumple protocolo inicial , continua indicando las características del producto, dejando claro lo mas relevante (pues es un cliente que ya tiene la información), cierra indicando que la base ya esta finalizando  y desea que no se pierda el beneficio, cliente interrumpe indicando que no lo necesita, ante la negativa, el asesor es persuasivo buscando su aceptación, y hace ejemplos de como podría usarlo ademas de simulaciones de posibles cuotas, pero el Sr. no acepta, para finalizar oferta la tc afiliada, ante este ofrecimiento si muestra interés, se completa la información al realizar el cierre, cliente pide tiempo para analizar a quien puede entregársela, y se genera agendamiento.\r\n', 1, 4, '2018-12-10 16:51:05', '2018-12-10 16:51:05');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(792, 1025, 97, 8, '2018-12-07', '15:12:00', 1, '28715953', 'Consumidora se comunica reportando lo sucedido en la preparación de buñuelos maizena. Comparte que es fiel consumidora de nuestros productos y lleva años haciendo la misma preparación y rigiéndose por las instrucciones de la caja. Se encuentra en el momento tratando de freír los buñuelos, pero la prueba que agrega al aceite no sube, al bajar se quedan en el fondo y se pega al recipiente. ', 1, 4, '2018-12-10 17:46:20', '2018-12-10 17:46:20');
