	(793, 1026, 97, 8, '2018-12-10', '12:49:00', 1, '28757079', 'Se comunica consumidor y desea conocer información del Detergente Vel Rosita Ropa Oscura, sobre modo de uso y lugar de origen. ', 1, 4, '2018-12-10 18:02:33', '2018-12-10 18:02:33');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(794, 1027, 75, 5, '2018-12-07', '08:13:00', 1, '52528003', 'MARCELA MARIA SANCHEZ ARCILA,  saluda y se presenta de forma correcta, es una venta agendada, así que se coloca a la cliente en contexto, sobre la oferta, cliente muestra interés y se indaga sobre posibles deudas, se explican las deudas que pueden recogerse, ante esto la cliente duda e indica no esta segura si su crédito es rotativo o de inversión el asesor debió explicar mejor la diferencia de los productos, para no tener que agendar, se acuerda un nuevo contacto, para cerrar la venta.\r\n', 2, 4, '2018-12-10 18:05:19', '2018-12-10 18:05:19');
