	(795, 1029, 64, 5, '2018-12-07', '07:32:00', 1, '71773208', 'NESTOR MARIO VELEZ VELEZ\r\nmaneja buen tono es cordial en el saludo, cumple con el guion legal, inicia con la oferta indicando la deuda de la tarjeta  realizando pregunta filtro, cliente manifiesta que tiene compra de cartera, asesora le explica en que consiste el rediferido pero el cliente indica que eso esta muy reciente, así que no se realizan modificaciones, la asesora entonces oferta la tc afiliada, maneja las objeciones dando ejemplos y con buenos argumentos, el Sr. aun así el cliente no muestra interés y se niega a aceptar', 2, 4, '2018-12-10 18:13:07', '2018-12-10 18:13:07');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(796, 1037, 80, 5, '2018-12-07', '15:56:00', 1, '1050037517', 'LAURA ESTEFANIA YASPE CARVAL, cumple protocolo inicial, hace falta dinamismo, es puntual con la oferta, resalta la baja de la tasa de interés, y genera la pregunta filtro, a la cliente le cuesta entender, así que se vuelve a explicar el beneficio, al entender la cliente indica que no desea realizar modificaciones a plazos tan largos, el continua dando manejo a las objeciones pero la cliente de forma cortante indica que no lo quiere, para finalizar el asesor oferta la tc afiliada, cliente tampoco la acepta, el asesor es persuasivo, pero falta mas dinamismo y creatividad al manejar la información.', 2, 4, '2018-12-10 18:23:14', '2018-12-10 18:23:14');
