	(797, 1028, 93, 8, '2018-12-07', '13:10:00', 1, '28672324', 'Consumidora indica que adquirió un Shampoo Savital con embrión de pato, y al momento de utilizarlo por primera vez, noto características diferentes de lo habitual en el producto como, cambio de color por un amarillo mas opaco, poca espuma, y consistencia final muy grasosa en su cabello, ', 1, 4, '2018-12-10 18:36:50', '2018-12-10 18:36:50');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(798, 1038, 128, 5, '2018-12-07', '12:04:00', 1, '21101281', 'RUTH CLEMENCIA OTALORA VASQUEZ, se presenta cumpliendo todo el protocolo inicial, es una cliente que ya tiene la información, entra cerrando recordando la tasa preferencial, y preguntando por deudas que tengan para consolidar, la cliente indica desea consultarlo, el asesor muy pro activo intenta que la cliente consulte los datos mientras el la espera en linea, pero la sra, se niega diciendo que va de viaje y esta conduciendo, que si se puede espera la llamada el día lunes, el asesor persiste indicando que el proceso es muy sencillo, pero ella no cede, se agenda un nuevo contacto.\r\n\r\n', 2, 4, '2018-12-10 18:41:51', '2018-12-10 18:41:51');
