	(800, 1040, 91, 8, '2018-12-10', '14:43:00', 1, '28762512', 'Consumidora indica que compró varias cajas de Natilla en un Autoservicio que se llama Ahorra Mas, y había una publicidad que decía que por la compra de dos cajas de natilla y/o buñuelo Maizena llevaba gratis un candelabro  en primera instancia compró 10 cajas y luego otras 10. Indica que los compró en el mes de noviembre y esta es la hora que no le dan los candelabros,', 1, 4, '2018-12-10 19:04:07', '2018-12-10 19:04:07');
