	(801, 1041, 100, 8, '2018-12-10', '19:08:00', 1, '28775448', 'Consumidora se contacta para reportar el producto KNO SOPA FID C/POLLO 95 GR, ya que al prepararlo y vaciarlo en un recipiente notó un plástico traslucido de aproximadamente 5 cm de contextura blanda, informa que siempre ha consumido esta variedad y es la primera vez que le sucede esto.', 1, 4, '2018-12-11 08:43:33', '2018-12-11 08:43:33');
