	(802, 1042, 100, 8, '2018-12-07', '15:56:00', 1, '28719140', 'Consumidora se contacta solicitando informacion para preparar la receta de SOPA TARASCA con producto Caldillo Rojo de Knorr. ', 1, 4, '2018-12-11 09:14:09', '2018-12-11 09:14:09');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(803, 1043, 92, 8, '2018-12-07', '18:52:00', 1, '28723505', 'Se contacta a la consumidora y se indaga de lo que sucede con el producto, ella indica que hace varios años ha usado la MAYONESA IBERIA de 3.8L, sin embargo en los últimos 3 meses ha tenido inconveniente, porque al envasar el contenido en un dosificador y después de poner un plástico de polipapel, la mayonesa se fermenta y rompe el plástico causando así derrames', 1, 1, '2018-12-11 09:40:59', '2018-12-11 09:40:59');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(804, 1044, 92, 8, '2018-12-10', '12:46:00', 1, '28756902', 'Consumidora indica que adquirió el Rexona antibacterial invisible, pero después de usarlo por un tiempo noto que le quedaba mancha blanca en la ropa.', 1, 4, '2018-12-11 09:56:41', '2018-12-11 09:56:41');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(805, 1045, 88, 8, '2018-12-07', '14:31:00', 1, '28713183', 'Consumidora desea saber por que el producto CALDILLO DE TOMATE KNORR cuenta con una consistencia diferente ya que en unos envases sale muy liquida y en otras muy espesa como un pure.', 1, 4, '2018-12-11 10:54:06', '2018-12-11 10:54:06');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(806, 1046, 88, 8, '2018-12-10', '13:12:00', 1, '28758418', 'Consumidora desea manifestar que el producto DOVE DEO AERO DERMO ACLARANT, desde el primer uso no le funciona de manera correcta la válvula ya que cuando se presiona queda abajo (atascada) y no vuelve a subir haciendo que se salga todo el producto. ', 1, 4, '2018-12-11 13:16:25', '2018-12-11 13:16:25');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(807, 1047, 85, 8, '2018-12-07', '14:54:00', 1, '28714560', 'Consumidora solicita informacion sobre las diferencias que hay entre Knorr zuiza caldo de pollo y Knorr Condimix. ', 1, 4, '2018-12-11 13:32:28', '2018-12-11 13:32:28');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(808, 1048, 85, 8, '2018-12-10', '12:42:00', 1, '28756672', 'Está interesado en adquirir diferentes variedades de la marca Knorr para su negocio Auge integral gran recinto ubicado en Tlalnepantla de Baz, solicita informacion. ', 1, 4, '2018-12-12 09:32:47', '2018-12-12 09:32:47');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(809, 1049, 86, 8, '2018-12-11', '17:28:00', 1, '28811325', 'Se recibe queja de un usuario que comenta que el envase del limpiador facial Sensitive derrama mucho producto al cerrar el producto debido a que se tiene que oprimir nuevamente. \r\nÉl indica que empezó a utilizar el producto pero el dispensador del mismo es muy inútil y cuando lo desea asegurar al tener que oprimir nuevamente la tapa siempre se genera perdidas del producto. ', 1, 4, '2018-12-12 09:42:03', '2018-12-12 09:42:03');
INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(810, 1050, 86, 8, '2018-12-10', '15:22:00', 1, '28765206', 'NOS COMUNICAMOS CON LA CONSUMIDORA PARA REALIZAR SEGUIMIENTO A LA ENCUESTA Y NOS INDICA LO SIGUIENTE: \r\nLa calificación brindada se deba a que no le brindaron una respuesta real y nos indica que desea saber el estado de su reporte y una respuesta de parte de la fábrica con la información de lo que pudo haber sucedido con el caso y las acciones que se tomarán para que no se vuelva a repetir.', 1, 4, '2018-12-12 09:53:56', '2018-12-12 09:53:56');
